import React, { useEffect, useRef, useState } from "react";
import axios from "axios";
import { useReactToPrint } from "react-to-print";
import { useNavigate } from "react-router-dom";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
import BatchNav from "../BatchNav/BatchNav";
import Header from "../Header/Header";

const URL = "http://localhost:5000/batches";

const fetchHandler = async () => {
  return await axios.get(URL).then((res) => res.data);
};

function BatchDetails() {
  const [batches, setBatches] = useState([]);
  const [searchQuery, setSearchQuery] = useState("");
  const [noResult, setNoResult] = useState(false);

  const componentRef = useRef();
  const navigate = useNavigate();

  useEffect(() => {
    fetchHandler().then((data) => {
      setBatches(data.batches || []);
    });
  }, []);

  // Print
  const handlePrint = useReactToPrint({
    content: () => componentRef.current,
    documentTitle: "Batch Report",
    onAfterPrint: () => alert("Batch Report Successfully Downloaded! âœ…"),
  });

  // Search
  const handleSearch = () => {
    fetchHandler().then((data) => {
      const filteredBatches = data.batches.filter((batch) =>
        batch.batchid?.toString().toLowerCase() === searchQuery.toLowerCase()
      );
      setBatches(filteredBatches);
      setNoResult(filteredBatches.length === 0);
    });
  };

  // WhatsApp
  const handleSendReport = () => {
    const phoneNumber = "+94718943262";
    const message = `Selected Batch Reports`;
    const WhatsAppUrl = `https://web.whatsapp.com/send?phone=${phoneNumber}&text=${encodeURIComponent(
      message
    )}`;
    window.open(WhatsAppUrl, "_blank");
  };

  // Delete batch
  const handleDelete = async (id) => {
    if (window.confirm("Are you sure you want to delete this batch?")) {
      await axios.delete(`${URL}/${id}`);
      setBatches((prev) => prev.filter((batch) => batch._id !== id));
    }
  };

  // Enhanced PDF Download with Header and Footer
  const handleDownloadPDF = () => {
    const doc = new jsPDF();
    
    // To get your logo's base64: go to https://base64.guru/converter/encode/image
    const logoBase64 = "data:image/png;base64,"; // Add your base64 image code here
    
    // Page dimensions
    const pageWidth = doc.internal.pageSize.width;
    const pageHeight = doc.internal.pageSize.height;
    const margin = 15;
    
    // Add border to the entire page
    doc.setDrawColor(20, 83, 45); // Green-900 color for border
    doc.setLineWidth(2);
    doc.rect(margin, margin, pageWidth - (margin * 2), pageHeight - (margin * 2));
    
    // Header Section
    doc.setFillColor(20, 83, 45); // Green-900 background
    doc.rect(margin + 3, margin + 3, pageWidth - (margin * 2) - 6, 30, 'F');
    
    // Add Logo
    try {
      doc.addImage(logoBase64, 'PNG', margin + 8, margin + 8, 16, 16);
    } catch (error) {
      console.log('Logo could not be added:', error);
      // Fallback: Create a simple circle placeholder
      doc.setFillColor(255, 255, 255);
      doc.circle(margin + 16, margin + 16, 8, 'F');
    }
    
    // Company Name
    doc.setTextColor(255, 255, 255); // White text
    doc.setFontSize(20);
    doc.setFont(undefined, 'bold');
    doc.text("EcoFungi", margin + 28, margin + 15);
    
    // Subtitle
    doc.setFontSize(10);
    doc.setFont(undefined, 'normal');
    doc.text("Batch Management System", margin + 28, margin + 22);
    
    // Date and time of report generation (positioned properly within border)
    doc.setTextColor(255, 255, 255);
    doc.setFontSize(8);
    const reportDate = `Report Generated: ${new Date().toLocaleString()}`;
    const textWidth = doc.getTextWidth(reportDate);
    doc.text(reportDate, pageWidth - margin - textWidth - 5, margin + 15);
    
    // Main Title
    doc.setTextColor(20, 83, 45);
    doc.setFontSize(16);
    doc.setFont(undefined, 'bold');
    doc.text("Batch Details Report", margin + 5, margin + 50);
    
    // Add a line under title
    doc.setDrawColor(20, 83, 45);
    doc.setLineWidth(1);
    doc.line(margin + 5, margin + 53, pageWidth - margin - 5, margin + 53);
    
    // Summary statistics
    const totalBatches = batches.length;
    const activeBatches = batches.filter(b => b.status.toLowerCase() === "active").length;
    const expiredBatches = batches.filter(b => b.status.toLowerCase() === "expired").length;
    const totalQuantity = batches.reduce((sum, b) => sum + (b.quantity || 0), 0);
    const totalRemoved = batches.reduce((sum, b) => sum + (b.removedQuantity || 0), 0);
    
    doc.setTextColor(0, 0, 0);
    doc.setFontSize(10);
    doc.setFont(undefined, 'normal');
    doc.text(`Total Batches: ${totalBatches}`, margin + 5, margin + 63);
    doc.text(`Active Batches: ${activeBatches}`, margin + 5, margin + 70);
    doc.text(`Expired Batches: ${expiredBatches}`, margin + 5, margin + 77);
    doc.text(`Total Quantity: ${totalQuantity}`, margin + 70, margin + 63);
    doc.text(`Total Removed: ${totalRemoved}`, margin + 70, margin + 70);
    doc.text(`Available Quantity: ${totalQuantity - totalRemoved}`, margin + 70, margin + 77);
    
    const reportPeriod = batches.length > 0 ? 
      `${new Date(batches[0].createDate).toLocaleDateString()} - ${new Date(batches[batches.length-1].createDate).toLocaleDateString()}` 
      : 'No data available';
    doc.text(`Report Period: ${reportPeriod}`, margin + 5, margin + 84);
    
    // Prepare table data
    const tableColumn = ["#", "Batch ID", "Created", "Expires", "Status", "Quantity", "Removed", "Available"];
    const tableRows = batches.map((batch, i) => [
      i + 1,
      batch.batchid.toString(),
      batch.createDate ? new Date(batch.createDate).toLocaleDateString() : "N/A",
      batch.expireDate ? new Date(batch.expireDate).toLocaleDateString() : "N/A",
      batch.status ?? "N/A",
      batch.quantity ?? "N/A",
      batch.removedQuantity ?? "N/A",
      (batch.quantity - batch.removedQuantity) ?? "N/A"
    ]);
    
    // Create table with enhanced styling
    autoTable(doc, {
      head: [tableColumn],
      body: tableRows,
      startY: margin + 94,
      theme: 'striped',
      headStyles: {
        fillColor: [20, 83, 45], // Green-900 header
        textColor: [255, 255, 255], // White text
        fontSize: 10,
        fontStyle: 'bold',
        halign: 'center'
      },
      bodyStyles: {
        fontSize: 9,
        halign: 'center'
      },
      columnStyles: {
        0: { halign: "center", cellWidth: 10 },
        5: { halign: "right" },
        6: { halign: "right" },
        7: { halign: "right" }
      },
      alternateRowStyles: {
        fillColor: [248, 250, 252] // Very light gray for alternate rows
      },
      styles: {
        lineColor: [20, 83, 45],
        lineWidth: 0.5,
        cellPadding: 3
      },
      margin: { left: margin + 5, right: margin + 5 },
      didDrawPage: function (data) {
        // Add border on each new page
        doc.setDrawColor(20, 83, 45);
        doc.setLineWidth(2);
        doc.rect(margin, margin, pageWidth - (margin * 2), pageHeight - (margin * 2));
        
        // Header on each new page
        if (data.pageNumber > 1) {
          doc.setFillColor(20, 83, 45);
          doc.rect(margin + 3, margin + 3, pageWidth - (margin * 2) - 6, 30, 'F');
          
          try {
            doc.addImage(logoBase64, 'PNG', margin + 8, margin + 8, 16, 16);
          } catch (error) {
            doc.setFillColor(255, 255, 255);
            doc.circle(margin + 16, margin + 16, 8, 'F');
          }
          
          doc.setTextColor(255, 255, 255);
          doc.setFontSize(20);
          doc.setFont(undefined, 'bold');
          doc.text("EcoFungi", margin + 28, margin + 15);
          
          doc.setFontSize(10);
          doc.setFont(undefined, 'normal');
          doc.text("Batch Management System", margin + 28, margin + 22);
        }
        
        // Footer on each page (positioned within border)
        const pageCount = doc.internal.getNumberOfPages();
        const footerY = pageHeight - margin - 20;
        
        // Footer background
        doc.setFillColor(248, 250, 252);
        doc.rect(margin + 5, footerY, pageWidth - (margin * 2) - 10, 15, 'F');
        
        // Footer border line
        doc.setDrawColor(200, 200, 200);
        doc.setLineWidth(0.5);
        doc.line(margin + 5, footerY, pageWidth - margin - 5, footerY);
        
        // Footer text
        doc.setTextColor(75, 85, 99);
        doc.setFontSize(8);
        doc.text('EcoFungi Batch Management System', margin + 8, footerY + 8);
        doc.text(`Generated on ${new Date().toLocaleDateString()}`, margin + 8, footerY + 12);
        
        // Page number (right aligned within border)
        const pageText = `Page ${data.pageNumber} of ${pageCount}`;
        const pageTextWidth = doc.getTextWidth(pageText);
        doc.text(pageText, pageWidth - margin - pageTextWidth - 8, footerY + 10);
      }
    });
    
    // Add disclaimer or notes at the bottom if there's space
    const finalY = doc.lastAutoTable.finalY || (margin + 94);
    if (finalY < pageHeight - 80) {
      doc.setFontSize(8);
      doc.setTextColor(107, 114, 128);
      doc.text('Note: This report contains batch data collected by EcoFungi management system.', margin + 8, finalY + 15);
      doc.text('â€¢ Please verify expired batches and update status accordingly.', margin + 8, finalY + 22);
      doc.text('â€¢ For any discrepancies, contact the inventory management team.', margin + 8, finalY + 29);
    }
    
    // Save the PDF
    doc.save(`EcoFungi_Batch_Report_${new Date().toISOString().split('T')[0]}.pdf`);
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Sidebar fixed on left */}
      <div className="fixed top-0 left-0 w-64 h-full bg-white shadow-md z-40">
        <BatchNav />
      </div>

      {/* Header fixed on top, only over main content */}
      <div className="fixed top-0 left-64 right-0 z-50">
        <Header />
      </div>

      {/* Main Content */}
      <div className="ml-64 pt-20 flex justify-center items-start p-6">
        <div className="w-full max-w-6xl bg-white shadow-lg rounded-xl p-6">

        {/* Report Content (Printable Section) */}
        <div ref={componentRef}>
          <h1 className="text-2xl font-bold text-gray-800 mb-6 border-b pb-2">
            Batch Details
          </h1>

          {/* Search Section */}
          <div className="flex gap-3 mb-6 print:hidden">
            <input
              onChange={(e) => setSearchQuery(e.target.value)}
              type="text"
              name="search"
              placeholder="Search batch details..."
              className="flex-1 px-4 py-2 border rounded-lg focus:ring-2 focus:ring-blue-500 outline-none"
            />
            <button
              onClick={handleSearch}
              className="px-5 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition"
            >
              Search
            </button>
          </div>

          {/* Batch Cards */}
          {noResult ? (
            <div className="text-center text-red-600 font-medium">
              <p>No batch found</p>
            </div>
          ) : (
            <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-3">
              {batches &&
                batches.map((batch, i) => (
                  <div
                    key={i}
                    className="p-5 border rounded-lg shadow-sm bg-gray-50 hover:shadow-md transition flex flex-col justify-between"
                  >
                    <div>
                      
                      <p>
                        <span className="font-medium">Batch ID:</span>{" "}
                        {batch.batchid}
                      </p>
                      <p>
                        <span className="font-medium">Create Date:</span>{" "}
                        {new Date(batch.createDate).toLocaleDateString()}
                      </p>
                      <p>
                        <span className="font-medium">Expire Date:</span>{" "}
                        {new Date(batch.expireDate).toLocaleDateString()}
                      </p>
                      <p>
                        <span className="font-medium">Status:</span>{" "}
                        <span
                          className={`px-2 py-1 rounded text-white text-sm ${
                            batch.status.toLowerCase() === "active"
                              ? "bg-green-600"
                              : "bg-red-500"
                          }`}
                        >
                          {batch.status}
                        </span>
                      </p>
                      <p>
                        <span className="font-medium">Quantity:</span>{" "}
                        {batch.quantity}
                      </p>
                      <p>
                        <span className="font-medium">Removed:</span>{" "}
                        {batch.removedQuantity}
                      </p>
                      <p>
                        <span className="font-medium">Available:</span>{" "}
                        {batch.quantity - batch.removedQuantity}
                      </p>
                    </div>

                    {/* Update & Delete Buttons (hidden in print) */}
                    <div className="flex gap-3 mt-4 print:hidden">
                      <button
                        onClick={() => navigate(`/updatebatch/${batch._id}`)}
                        className="flex-1 px-4 py-2 bg-yellow-500 text-white rounded-lg hover:bg-yellow-600 transition"
                      >
                        Update
                      </button>
                      <button
                        onClick={() => handleDelete(batch._id)}
                        className="flex-1 px-4 py-2 bg-red-600 text-white rounded-lg hover:bg-red-700 transition"
                      >
                        Delete
                      </button>
                    </div>
                  </div>
                ))}
            </div>
          )}
        </div>

        {/* Action Buttons (hidden in print) */}
        <div className="flex justify-end gap-4 mt-8 print:hidden">
          <button
            onClick={handleDownloadPDF}
            className="px-5 py-2 bg-green-600 text-white rounded-lg hover:bg-green-700 transition"
          >
            Download PDF Report
          </button>

          <button
            onClick={handleSendReport}
            className="px-5 py-2 bg-indigo-600 text-white rounded-lg hover:bg-indigo-700 transition"
          >
            Send WhatsApp Message
          </button>
        </div>
        </div>
      </div>
    </div>
  );
}

export default BatchDetails;